package com.SymbolPatterns;

public class Pattern1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		 System.out.println("OUTPUT: ");
		 for (int iRow = 1; iRow <= 5; iRow++) {
	            for (int iCol = 1; iCol <= 5; iCol++) {
	                System.out.print("*");
	            }
	            System.out.println();
	        }
	}
}
/* OUTPUT: 

	*****
	*****
	*****
	*****
	*****
*/
